def caesar_decrypt(ciphertext, shift):
    decrypted_text = ""
    for char in ciphertext:
        if char.isalpha():
            shift_amount = shift % 26
            new_char = ord(char) - shift_amount
            if char.isupper():
                if new_char < ord('A'):
                    new_char += 26
            elif char.islower():
                if new_char < ord('a'):
                    new_char += 26
            decrypted_text += chr(new_char)
        else:
            decrypted_text += char
    return decrypted_text

